I&#x27;ve tried searching for this but the confluence of search terms required results in a lot of off-topic results.<p>Basically let&#x27;s say I&#x27;m using Tailwind with React, and I frequently use the pattern:<p>&lt;div className=&quot;flex flex-row justify-center w-full&quot;&gt;
...
&lt;&#x2F;div&gt;<p>Is there any tool out there that will analyze a project&#x27;s source and look for these patterns, and suggestions for creation of components out of them? I could have sworn I saw this as a VSCode Extension or something at one point.
